import { AbstractPortFactory } from "storm-react-diagrams";
import { Port } from "../models/Port";

export class PortLabelFactory extends AbstractPortFactory<Port> {
	constructor() {
		super("with_prop");
	}

	getNewInstance(initialConfig?: any): Port {
		return new Port(true, "with_prop");
	}
}
